  const [darkTheme, setDarkTheme] = useState(false);

  return (
    <nav>
      <Link to="/Home">Home</Link>
      <Link to="/Favs">Favs</Link>
      <Link to="/Detail">Detail</Link>
      <Link to="/Contact">Contact</Link>
      <button>Cambiar el tema</button>
    </nav>
  )
}

export default Navbar
